import React from "react";
import { Link } from "react-router-dom";
import "./VolunteeringPage.css";

const VolunteeringPage = () => {
  return (
    <div
      className="volunteering-page"
      style={{
        background: `linear-gradient(rgba(0,0,0,0.2), rgba(0,0,0,0.1)), url('/img/wolontariat2.jpg') center/cover no-repeat`,
      }}
    >
      <div className="volunteer-container">
        <h1>Wolontariat w schronisku</h1>

        <p>
          Zostań wolontariuszem naszego schroniska! Możesz pomagać w opiece nad psami i kotami,
          uczestniczyć w spacerach i zabawach, a także zbierać punkty, które możesz wymienić na nagrody.
        </p>

        <div className="volunteer-info">
          <h3>Jak możesz pomóc?</h3>
          <ul>
            <li>Spacer z psem</li>
            <li>Zabawa z kotem</li>
            <li>Sprzątanie boksów</li>
            <li>Pomoc w karmieniu i opiece</li>
          </ul>

          <h3>Punkty i nagrody</h3>
          <ul>
            <li>Kubek – 50 punktów</li>
            <li>Plecak – 100 punktów</li>
            <li>Skarpetki – 30 punktów</li>
            <li>Czekolada / batonik – 20 punktów</li>
            <li>Karma dla zwierzaka – 80 punktów</li>
          </ul>

          <p>
            Aby dołączyć do wolontariatu,{" "}
            <Link to="/volunteer-login">zaloguj się lub zarejestruj konto</Link>.
          </p>
        </div>
      </div>
    </div>
  );
};

export default VolunteeringPage;
